import React from 'react';
import classes from '.Login.css';

const Login = (props) => {
    return (
        <div className={classes.Login}>
            <div>
                <h1>Авторизация</h1>

                <form>
                    <input type="text" />
                    <input type="text" />
                    <Button>Войти</Button>
                </form>
            </div>
        </div>
    )
}

export default Login;
